CREATE TABLE IF NOT EXISTS &quot;synaptic_atendimento&quot; (
	&quot;id&quot;	integer NOT NULL,
	&quot;nome_unidade_ensino&quot;	varchar(255) NOT NULL,
	&quot;ano_serie&quot;	varchar(255) NOT NULL,
	&quot;nome_turma&quot;	varchar(255) NOT NULL,
	&quot;classificacao_nome&quot;	varchar(255) NOT NULL,
	&quot;tipo_ocorrencia_nome&quot;	varchar(255) NOT NULL,
	&quot;registro&quot;	datetime NOT NULL,
	&quot;status_descricao&quot;	varchar(255) NOT NULL,
	&quot;created_at&quot;	datetime NOT NULL,
